.box {
    width: 100px;
    height: 100px;
    background-color: #0074d9;
    border-radius: 50%;
    margin-bottom: 20px;
  }
  
  body {
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    min-height: 400px;
  }

  .carousel {
    display: flex;
    align-items: stretch;
    height: 150px;
    position: relative;
  }
  .carousel .item {
    background-color: rgb(122, 76, 120);
    border-radius: 5px;
    margin-right: 15px;
    flex: 0 0 110px;
  }
  .carousel .item:nth-child(4n + 2) {
    background: rgb(75, 161, 58);
  }
  .carousel .item:nth-child(4n + 3) {
    background: rgb(187, 118, 158);
  }
  .carousel .item:nth-child(4n + 4) {
    background: rgb(64, 90, 145);
  }
